import React, { Fragment } from 'react';

class TodoList extends React.Component {
    render() {
        return (
            <Fragment>
                <div>
                    <input />
                    <button>提交</button>
                </div>
                <ul>
                    <li>1</li>
                    <li>1</li>
                    <li>1</li>
                    <li>1</li>
                </ul>
            </Fragment>
        );
    }
}

export default TodoList;
